import React from 'react';
import axios from '../api/axios';


const Profile = () => {
const userId = localStorage.getItem('userId');
const USERS_URL = 'http://localhost:8000/users.php';

 axios.post(USERS_URL, JSON.stringify({userId}))
        .then((result) => {
            console.log(result.data);
            const firstName = result.data.firstname;
            const lastName = result.data.lastname;
            const age = result.data.age;
            const mail = result.data.mail;
            const phoneNr = result.data.phonenr;
        }
    )

    return(
      <>
      <h1>Profile</h1>
        <h2>Hello </h2>
        <form>
            <input type="text" >{firstName}</input>
            <input type="text" placeholder={lastName}></input>
            <input type="text" placeholder={age}></input>
            <input type="text" placeholder={mail}></input>
            <input type="text" placeholder={phoneNr}></input>
        </form>
    </>
  );
  };

  export default Profile;
